Binary exponentiation, also known as exponentiation by squaring, is a method for raising a number to a power \(n\) efficiently. It reduces the number of multiplications required to calculate \(a^n\) compared to the naive method. The idea behind binary exponentiation is to use the binary representation of the exponent \(n\) and square the base \(a\) successively, multiplying it into the result whenever the corresponding bit in the binary representation of \(n\) is 1.

